import React from "react"
import { connect } from 'react-redux'

const UsersBanks = (props) => {


  return (
    <div className="card" style={{"width": "18rem"}}>
      <div className="card-header"> {props.user.username} </div>
      <ul className="list-group list-group-flush">
        {props.banks.map(bank => <li key={bank.id}className="list-group-item">{bank.name}</li>)}
      </ul>
    </div>
  )

}

const mapStateToProps = (state) => {
  return {
    state
  }
}

const mapDispacthToProps = (dispatch) => {
  return {
    dispatch
  }
}

export default connect(mapStateToProps, mapDispacthToProps)(UsersBanks)
